const Interests = () => {
    return (
        <div className='text-gray-800 text-center px-5 mb-5 my-2'>
            <h2>Interests</h2>
            <p>Super interested in street photography and canpturing special moments in an urban environment.</p>
        </div>
    );
}

export default Interests;
